import Legal from './LegalForm/LegalForm.js';
import Enterpreneur from './EnterpreneurForm/EnterpreneurForm.js'; 

const form = (props) => {
  return (
    <div>
      {props.active === 'legal' ? <Legal /> : <Enterpreneur />}
    </div>
  );
};

export default form;
